import './ExpenseItem.css';
 

function ExpenseItem(){
    return(
        <>
        <h1 className="expense-item">Expense Item</h1>
        <h2>Car insurance</h2>
        <span>$200</span>

        <h2>Health insurance</h2>
        <span>$500</span>
        </>
    )
}

export default ExpenseItem;
